import Vue from 'vue'
import Vuex from 'vuex'

Vue.use(Vuex)

export default new Vuex.Store({
  state: {
    isLogin:false,
    uname:""
  },
  mutations: {
    signin(state,uname){ 
      state.isLogin=true;
      state.uname=uname; 
    },
    signout(){ 
      this.state.isLogin=false;
      this.state.uname="";
    }
  },
  actions: {

  }
})
